               https://todearhemant.pythonanywhere.com/patient/api/patients/`,{

               method:'post',
               
               headers:{
                'Content-Type':'application/json'
               },
               body: JSON.stringify(newuser)
            });
                
                let nota =  await response.json();         

                console.log(nota)
                setData(nota);
                
            }
            catch (error){

                console.log("data is fallid",error);


            }
            }
            fechdata()
           
        },[])
        
    

return (
    <div>

        {data.map(patient=>(

        <div key={patient.id}>
            
            
           { <Showdata patient={patient} />}
            </div>

))}

</div>
        )
        
    }
